  //     .then((response) => response.json())
  //     .then((json) => setOutro(json));
  // }, [id]);
  // console.log(id);
  return (
    <div>
      {outro && (
        <div>
          <p>{outro.id}</p>
          <p>{outro.title}</p>
          <p>{outro.body}</p>
        </div>
      )}
    </div>
  );
}
export default Page;
